import React, { useEffect } from 'react'
import axios from 'axios'

const Persons = ({ searchPersons }) => {
    useEffect(() => {
        axios
            .get('')
    })
    return(
        <div>
        <ul>
            {searchPersons.map((person, id) => <li key = {id}>{person.name} {person.number}</li>)}
        </ul>
       </div>
    )
}

export default Persons
